const games = [
  { nombre: "God of War: Ragnarök", genero: "Acción", plataforma: "PlayStation", imagen: "data:image/jpeg;base64," },
  { nombre: "Resident Evil 4 Remake", genero: "Terror", plataforma: "Multiplataforma", imagen: "https://image.api.playstation.com/vulcan/ap/rnd/202210/0712/BiS5QP6h4506JHyJlZlVzK9D.jpg" },
  { nombre: "Cuphead", genero: "Plataformas", plataforma: "PC / Xbox", imagen: "data:image/png;base64," },
  { nombre: "Minecraft", genero: "Estrategia", plataforma: "Multiplataforma", imagen: "data:image/jpeg;base64," },
  { nombre: "Assassin’s Creed Valhalla", genero: "Aventura", plataforma: "Multiplataforma", imagen: "data:image/jpeg;base64," },
  { nombre: "The Last of Us Part I", genero: "Aventura", plataforma: "PlayStation", imagen: "data:image/jpeg;base64," },
  { nombre: "League of Legends", genero: "Estrategia", plataforma: "PC", imagen: "data:image/jpeg;base64," },
  { nombre: "FIFA 23", genero: "Deportes", plataforma: "Multiplataforma", imagen: "data:image/jpeg;base64," },
  { nombre: "Bayonetta 3", genero: "Acción", plataforma: "Nintendo Switch", imagen: "data:image/jpeg;base64," },
  { nombre: "Five Nights at Freddy’s", genero: "Terror", plataforma: "PC / Consolas", imagen: "data:image/jpeg;base64,:image/jpeg;base64," }
];

const catalog = document.getElementById('gameCatalog');
const filterGenre = document.getElementById('filterGenre');
const sortOrder = document.getElementById('sortOrder');

function mostrarJuegos(lista) {
  catalog.innerHTML = '';
  lista.forEach(game => {
    const card = document.createElement('div');
    card.classList.add('game-card');
    card.innerHTML = `
      <img src="${game.imagen}" alt="${game.nombre}">
      <div class="game-info">
        <h3>${game.nombre}</h3>
        <p>${game.genero} | ${game.plataforma}</p>
      </div>
    `;

    // 👉 Cuando se hace clic, se guarda la info y se redirige
    card.addEventListener('click', () => {
      localStorage.setItem('selectedGame', JSON.stringify(game));
      window.location.href = 'consejos.html';
    });

    catalog.appendChild(card);
  });
}

function filtrarYOrdenar() {
  let lista = [...games];
  const genero = filterGenre.value;
  const orden = sortOrder.value;

  if (genero !== 'all') {
    lista = lista.filter(g => g.genero === genero);
  }

  lista.sort((a, b) => {
    if (orden === 'az') return a.nombre.localeCompare(b.nombre);
    else return b.nombre.localeCompare(a.nombre);
  });

  mostrarJuegos(lista);
}

filterGenre.addEventListener('change', filtrarYOrdenar);
sortOrder.addEventListener('change', filtrarYOrdenar);

mostrarJuegos(games);
